THE MAN FROM U.N.C.L.E.
Season 1, Episode 14: &quot;The Terbuf Affair&quot;

Solo and Kuryakin, spending some off-time in Rome, are approached by Clara, an old flame of Solo&amp;#039;s. She seeks Solo&amp;#039;s help so Emil, a gypsy leader, can escape Terbuf along with papers that implicate the corrupt leadership of that country. Kuryakin tags along. His knowledge of gypsies and clear head (where Clara is concerned) will be of great assistance to Solo.

Act I &quot;A Deadly Holiday In The Balkans&quot;
Act II &quot;The Traps Are Set&quot;
Act III &quot;Arrange For a Firing Squad!&quot;
Act IV &quot;Ready...Aim...Fire!&quot;

Guest stars: Albert Paulsen IMaj Vicek), Jacques Aubuchon (Emil), Madlyn Rhue (Clara Valdar), 
Kurt Kreuger (Stefan Valder), Alan Caillou (Col Morisco), Michael Forest (Lt Fest)

